import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import BottomNavigation from "@material-ui/core/BottomNavigation"

const navbar = () => {
  return (
    <div>
      <AppBar>
        <Toolbar>
          <BottomNavigation
            value={value}
            onChange={handleChange}
            className={classes.root}
          >
            <BottomNavigationAction
              label="Recents"
              value="recents"
              icon={<RestoreIcon />}
            />
            <BottomNavigationAction
              label="Favorites"
              value="favorites"
              icon={<FavoriteIcon />}
            />
            <BottomNavigationAction
              label="Nearby"
              value="nearby"
              icon={<LocationOnIcon />}
            />
            <BottomNavigationAction
              label="Folder"
              value="folder"
              icon={<FolderIcon />}
            />
          </BottomNavigation>
        </Toolbar>
      </AppBar>
    </div>
  );
};

export default navbar;
